import React from 'react';

const ProviderItem = ({ id, name, image }) => {
  return (
    <a className='provider-item' href={`https://api.adkey-seo.com/storage/images/providers/${image}`} id={id}>
      <img src={`https://api.adkey-seo.com/storage/images/providers/${image}`} alt={name} title={name}/>  
    </a>
  );
};

const Providers = ({ providers }) => {
  return (
    <section className='providers'>
      <div className="container">
        <h2>
          SOFTWARE PROVIDERS
        </h2>
        <div className="providers-items inner-flex">
          {providers.map(provider => (
            <ProviderItem key={provider.id} {...provider} />
          ))}
        </div>
      </div>
    </section>
  );
};

export default Providers;
